// File: client/src/pages/Dashboard.js
import React, { useState, useEffect, useContext } from 'react';
import { AuthContext } from '../context/AuthContext';
import api from '../utils/api';

const Dashboard = () => {
  const { currentUser } = useContext(AuthContext);
  const [activeTab, setActiveTab] = useState('overview');
  const [gigs, setGigs] = useState([]);
  const [jobs, setJobs] = useState([]);
  const [orders, setOrders] = useState([]);
  const [bids, setBids] = useState([]);
  const [isLoading, setIsLoading] = useState(true);

  useEffect(() => {
    loadDashboardData();
  }, [activeTab]);

  const loadDashboardData = async () => {
    setIsLoading(true);
    try {
      if (currentUser.roles.includes('freelancer')) {
        const gigsResponse = await api.get('/gigs?owner=true');
        const ordersResponse = await api.get('/orders?role=freelancer');
        const bidsResponse = await api.get('/jobs/my-bids');

        setGigs(gigsResponse.data);
        setOrders(ordersResponse.data);
        setBids(bidsResponse.data);
      } else {
        const jobsResponse = await api.get('/jobs/my-jobs');
        const ordersResponse = await api.get('/orders?role=client');
        const bidsResponse = await api.get('/jobs/bids-received');

        setJobs(jobsResponse.data);
        setOrders(ordersResponse.data);
        setBids(bidsResponse.data);
      }
    } catch (err) {
      console.error('Error loading dashboard data:', err);
    } finally {
      setIsLoading(false);
    }
  };

  const renderTabContent = () => {
    if (isLoading) return <p>Loading...</p>;

    switch (activeTab) {
      case 'gigs':
        return gigs.map(gig => (
          <div key={gig._id} className="border p-4 mb-4">
            <h3>{gig.title}</h3>
            <p>Price: ₹{gig.price}</p>
          </div>
        ));
      case 'jobs':
        return jobs.map(job => (
          <div key={job._id} className="border p-4 mb-4">
            <h3>{job.title}</h3>
            <p>Budget: ₹{job.budget.min} - ₹{job.budget.max}</p>
          </div>
        ));
      case 'orders':
        return orders.map(order => (
          <div key={order._id} className="border p-4 mb-4">
            <h3>{order.title}</h3>
            <p>Status: {order.status}</p>
          </div>
        ));
      case 'bids':
        return bids.map(bid => (
          <div key={bid._id} className="border p-4 mb-4">
            <p>Proposal: {bid.proposal}</p>
            <p>Amount: ₹{bid.amount}</p>
          </div>
        ));
      default:
        return <p>Select a tab to view data.</p>;
    }
  };

  return (
    <div className="max-w-4xl mx-auto p-8">
      <h1 className="text-3xl font-bold text-center mb-6">Dashboard</h1>
      <div className="flex space-x-4 mb-6">
        {currentUser.roles.includes('freelancer') ? (
          <>
            <button onClick={() => setActiveTab('gigs')} className="bg-blue-500 text-white px-4 py-2 rounded">My Gigs</button>
            <button onClick={() => setActiveTab('orders')} className="bg-green-500 text-white px-4 py-2 rounded">My Orders</button>
            <button onClick={() => setActiveTab('bids')} className="bg-purple-500 text-white px-4 py-2 rounded">My Bids</button>
          </>
        ) : (
          <>
            <button onClick={() => setActiveTab('jobs')} className="bg-yellow-500 text-white px-4 py-2 rounded">My Jobs</button>
            <button onClick={() => setActiveTab('orders')} className="bg-green-500 text-white px-4 py-2 rounded">My Orders</button>
            <button onClick={() => setActiveTab('bids')} className="bg-purple-500 text-white px-4 py-2 rounded">Bids Received</button>
          </>
        )}
      </div>
      {renderTabContent()}
    </div>
  );
};

export default Dashboard;
